In this section, we compare our Efficient-FedRec framework for privacy-preserving news recommendation with several baseline methods, including
news recommendation methods with centralized storage:
(1) DFM Lian et al. (2018), a multi-channel deep fusion model for news recommendation;
(2) DKN Wang et al. (2018), a knowledge-aware news recommendation method;
(3) LSTUR An et al. (2019), using user id embedding to capture user long-term interests, and GRU network to capture short-term interests;
(4) NAML  Wu et al. (2019a), learning news representations via multi-view learning;
(5) NRMS  Wu et al. (2019c), using two self-attention networks for better news and user modeling;
(6) CenRec  Qi et al. (2020), a central version of FedRec;
(7) PLM-NR  Wu et al. (2021b), applying pre-trained language model to empower the performance of news recommendation. For fair comparison, we use the user model in NRMS.
privacy-preserving news recommendation methods:
(8) FCF  Ammad et al. (2019), federated collaborative filtering for recommendation;
(9) FedRec  Qi et al. (2020), privacy-preserving method for news recommendation model training. For fair comparison, we do not add differential privacy;
(10) FedRec(BERT), applying FedRec to train PLM-NR in a privacy-preserving way.
our method:
(11) Efficient-FedRec, using our Efficient-FedRec framework to train PLM-NR in a privacy-preserving and efficient way.
